import { StyleSheet } from "react-native";

export const styles = StyleSheet.create({
  filter: {
    padding: 30,
    flexDirection: "row",
    alignItems: "center",
    justifyContent: "space-between",
  },
  check: {
    marginRight: 35,
  },
  filterText: {
    lineHeight: 19,
    color: "#7E7E7E",
    fontSize: 16,
    fontFamily: "Roboto",
    fontStyle: "normal",
    fontWeight: "normal",
  },
});
